import React from 'react';

const Tournaments = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Tournaments</h1>
    </div>
  );
};

export default Tournaments;
